// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../interface/IPoolCreator.sol";
import "../interface/IFundCreator.sol";
import "../interface/IRiskCreator.sol";
import "../interface/ITradeCreator.sol";
import "../interface/IMineCreator.sol";
import "../interface/IPool.sol";
import "../interface/ITeemoToken.sol";

contract PoolFactory is Ownable {
    using SafeMath for uint256;

    event AddPool(address indexed tokenAddr, address indexed poolAddr);
    event AddFund(
        address indexed tokenAddr,
        address indexed poolAddr,
        address indexed createAddr
    );
    event AddRisk(
        address indexed tokenAddr,
        address indexed poolAddr,
        address indexed createAddr
    );
    event AddTrade(
        address indexed tokenAddr,
        address indexed poolAddr,
        address indexed createAddr
    );
    event AddMine(
        address indexed tokenAddr,
        address indexed poolAddr,
        address indexed createAddr
    );
    event LPDeposit(
        address _userAddr,
        uint256 indexed lpAmount,
        uint256 indexed teemoTokenAmount
    );
    event LPWithdraw(
        address _userAddr,
        uint256 indexed tokenAmount,
        uint256 indexed teemoTokenAmount
    );

    address[] allPoolAddr;
    mapping(address => uint256) private allPoolIndex;
    address public quoteFactoryAddr;
    address public teemoTokenAddr;
    address public poolCreatorAddr;
    address public fundCreatorAddr;
    address public riskCreatorAddr;
    address public tradeCreatorAddr;
    address public mineCreatorAddr;
    address public devAddr;

    constructor(
        address _quoteFactoryAddr,
        address _teemoTokenAddr,
        address _poolCreatorAddr,
        address _fundCreatorAddr,
        address _riskCreatorAddr,
        address _tradeCreatorAddr,
        address _mineCreatorAddr,
        address _devAddr
    ) public {
        quoteFactoryAddr = _quoteFactoryAddr;
        teemoTokenAddr = _teemoTokenAddr;
        poolCreatorAddr = _poolCreatorAddr;
        fundCreatorAddr = _fundCreatorAddr;
        riskCreatorAddr = _riskCreatorAddr;
        tradeCreatorAddr = _tradeCreatorAddr;
        mineCreatorAddr = _mineCreatorAddr;
        devAddr = _devAddr;
    }

    function poolLength() public view returns(uint256) {
        return allPoolAddr.length;
    }

    function getAllPoolInfo()
        public
        view
        returns (
            address[] memory allTeemoPoolAddr,
            address[] memory allTokenAddr,
            address[] memory allMainnetTokenAddr,
            string[] memory allSymbol
        )
    {
        allTeemoPoolAddr = allPoolAddr;
        allTokenAddr = new address[](allPoolAddr.length);
        allMainnetTokenAddr = new address[](allPoolAddr.length);
        allSymbol = new string[](allPoolAddr.length);

        for (uint256 i = 0; i < allPoolAddr.length; i++) {
            allTokenAddr[i] = IPool(allPoolAddr[i]).getTokenAddr();
            allMainnetTokenAddr[i] = IPool(allPoolAddr[i]).getMainnetTokenAddr();
            allSymbol[i] = ERC20(allTokenAddr[i]).symbol();
        }
    }

    function getTokenAddr() public view returns (address) {
        return IPool(allPoolAddr[0]).getTokenAddr();
    }

    function setQuoteFactoryAddr(address _quoteFactoryAddr) public onlyOwner {
        quoteFactoryAddr = _quoteFactoryAddr;
    }

    function setTeemoTokenAddr(address _teemoTokenAddr) public onlyOwner {
        teemoTokenAddr = _teemoTokenAddr;
    }

    function setDevAddr(address _devAddr) public onlyOwner {
        devAddr = _devAddr;
    }

    function addPool(address _tokenAddr, address _mainnetTokenAddr)
        public
        onlyOwner
        returns (address createAddr)
    {
        require(allPoolIndex[_tokenAddr] == 0, "addPool: POOL_EXISTS");
        createAddr = IPoolCreator(poolCreatorAddr).createPool(
            _tokenAddr,
            _mainnetTokenAddr,
            quoteFactoryAddr
        );
        allPoolAddr.push(createAddr);
        allPoolIndex[_tokenAddr] = allPoolAddr.length;
        emit AddPool(_tokenAddr, createAddr);
    }

    function addFund(address _tokenAddr)
        public
        onlyOwner
        returns (address createAddr)
    {
        address _poolAddr = getAddr(_tokenAddr);
        createAddr = IFundCreator(fundCreatorAddr).createFund(
            _poolAddr,
            _tokenAddr
        );
        IPool(_poolAddr).setFundAddr(createAddr);
        emit AddFund(_tokenAddr, _poolAddr, createAddr);
    }

    function addRisk(address _tokenAddr)
        public
        onlyOwner
        returns (address createAddr)
    {
        address _poolAddr = getAddr(_tokenAddr);
        createAddr = IRiskCreator(riskCreatorAddr).createRisk(
            _poolAddr,
            _tokenAddr
        );
        IPool(_poolAddr).setRiskAddr(createAddr);
        emit AddRisk(_tokenAddr, _poolAddr, createAddr);
    }

    function addTrade(address _tokenAddr)
        public
        onlyOwner
        returns (address createAddr)
    {
        address _poolAddr = getAddr(_tokenAddr);
        createAddr = ITradeCreator(tradeCreatorAddr).createTrade(
            _poolAddr,
            _tokenAddr,
            quoteFactoryAddr
        );
        IPool(_poolAddr).setTradeAddr(createAddr);
        emit AddTrade(_tokenAddr, _poolAddr, createAddr);
    }

    function addMine(
        address _tokenAddr,
        uint256 _teemoPerBlock,
        uint256 _startBlock
    ) public onlyOwner returns (address createAddr) {
        address _poolAddr = getAddr(_tokenAddr);
        createAddr = IMineCreator(mineCreatorAddr).createMine(
            _poolAddr,
            _tokenAddr,
            _teemoPerBlock,
            _startBlock
        );
        IPool(_poolAddr).setMineAddr(createAddr);
        emit AddMine(_tokenAddr, _poolAddr, createAddr);
    }

    function deposit(address _tokenAddr, uint256 _tokenAmount) public {
        address _poolAddr = getAddr(_tokenAddr);
        (
            uint256 teemoTokenAmount,
            uint256 userTeemoTokenAmount,
            uint256 lpAmount
        ) = IPool(_poolAddr).deposit(msg.sender, _tokenAmount);
        ITeemoToken(teemoTokenAddr).mint(address(this), teemoTokenAmount);
        ITeemoToken(teemoTokenAddr).mint(devAddr, teemoTokenAmount.div(10));
        safeTeemoTransfer(msg.sender, userTeemoTokenAmount);
        emit LPDeposit(msg.sender, lpAmount, teemoTokenAmount);
    }

    function withdraw(address _tokenAddr, uint256 _lpAmount) public {
        address _poolAddr = getAddr(_tokenAddr);
        (
            uint256 teemoTokenAmount,
            uint256 userTeemoTokenAmount,
            uint256 tokenAmount
        ) = IPool(_poolAddr).withdraw(msg.sender, _lpAmount);
        ITeemoToken(teemoTokenAddr).mint(address(this), teemoTokenAmount);
        ITeemoToken(teemoTokenAddr).mint(devAddr, teemoTokenAmount.div(10));
        safeTeemoTransfer(msg.sender, userTeemoTokenAmount);
        emit LPWithdraw(msg.sender, tokenAmount, teemoTokenAmount);
    }

    function getAddr(address _tokenAddr)
        public
        view
        returns (address poolAddr)
    {
        poolAddr = allPoolAddr[allPoolIndex[_tokenAddr].sub(1)];
        require(poolAddr != address(0), "getAddr: POOL_NOT_EXISTS");
    }

    function safeTeemoTransfer(address _to, uint256 _amount) internal {
        uint256 teemoBal = ITeemoToken(teemoTokenAddr).balanceOf(address(this));
        if (_amount > teemoBal) {
            ITeemoToken(teemoTokenAddr).transfer(_to, teemoBal);
        } else {
            ITeemoToken(teemoTokenAddr).transfer(_to, _amount);
        }
    }
}
